import React, { Fragment } from 'react';
import Header from './Header';
import Subheader from './Subheader';

const HomePageMain = () => {
    return (
        <Fragment>
            <Header></Header>
            <Subheader></Subheader>
        </Fragment>
    );
};

export default HomePageMain;
